import React from 'react'

const ListItem = (props) => {
    const singlePokemon = props.allPokemon.map((pokemon) => {
        return pokemon
    });

    return (
        <p>{props.allPokemon.map((pokemon) => {
            return <li>pokemon.name</li>
        }
        )}</p>
    )
}

export default ListItem
